import React from 'react';

function Main() {
  return (
    <div id="main">
      <article className="thumb">
        <a href="#work" className="image">Work</a>
      </article>
      <article class="thumb">
							<a href="./images/fulls/crocos-01.jpg" class="image">
								<img src="./images/fulls/crocos-01.jpg" alt="" />
							</a>
						</article>
    </div>
  );
}

export default Main;
